    data: |
      SELECT - 44 + col1 AS col0 FROM tab0 WHERE + 83 BETWEEN ( + col0 * - col2 * - col0 / - 43 + col0 + - col2 ) AND + col0;
  - name: tab0

outputs:
  - name: q7323.out
    data: |
      -23
      -43
